import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { Container, Typography, Paper, Button } from '@mui/material';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import { VaccinationRecordList } from '../components/VaccinationRecordList';
import { VaccinationRecordForm } from '../components/VaccinationRecordForm';
import { VaccinationRecord, VaccinationRecordFormData, Student } from '../types';
import { studentService, createVaccinationRecord, updateVaccinationRecord } from '../services/api';
import axios from 'axios';

const StudentVaccinationRecords: React.FC = () => {
  const { studentId } = useParams<{ studentId: string }>();
  const navigate = useNavigate();
  const [student, setStudent] = useState<Student | null>(null);
  const [isFormOpen, setIsFormOpen] = useState(false);
  const [selectedRecord, setSelectedRecord] = useState<VaccinationRecord | undefined>();
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    if (studentId) {
      loadStudent();
    }
  }, [studentId]);

  const loadStudent = async () => {
    try {
      const data = await studentService.getById(studentId!);
      setStudent(data);
      setError(null);
    } catch (err) {
      setError('Failed to load student data');
      console.error(err);
    }
  };

  const handleAdd = () => {
    setSelectedRecord(undefined);
    setIsFormOpen(true);
  };

  const handleEdit = (record: VaccinationRecord) => {
    setSelectedRecord(record);
    setIsFormOpen(true);
  };

  const handleSubmit = async (record: VaccinationRecordFormData) => {
    try {
      if (selectedRecord) {
        await updateVaccinationRecord(selectedRecord.recordId, record);
      } else {
        await createVaccinationRecord(record);
      }
      setIsFormOpen(false);
      // Refresh the list
      if (studentId) {
        loadStudent();
      }
    } catch (err) {
      setError('Failed to save vaccination record');
      console.error(err);
    }
  };

  const AddVaccinationRecordForm = ({ studentId, onRecordAdded }) => {
    const [vaccineName, setVaccineName] = useState('');
    const [dateAdministered, setDateAdministered] = useState('');
    const [administeredBy, setAdministeredBy] = useState('');

    const handleSubmit = async (e) => {
      e.preventDefault();
      await axios.post(`http://localhost:8080/api/students/${studentId}/vaccinations`, {
        vaccineName,
        dateAdministered,
        administeredBy,
      });
      setVaccineName('');
      setDateAdministered('');
      setAdministeredBy('');
      onRecordAdded(); // Refresh the records list
    };

    return (
      <form onSubmit={handleSubmit}>
        <input
          placeholder="Vaccine Name"
          value={vaccineName}
          onChange={e => setVaccineName(e.target.value)}
          required
        />
        <input
          type="date"
          value={dateAdministered}
          onChange={e => setDateAdministered(e.target.value)}
          required
        />
        <input
          placeholder="Administered By"
          value={administeredBy}
          onChange={e => setAdministeredBy(e.target.value)}
          required
        />
        <button type="submit">Add Vaccination Record</button>
      </form>
    );
  };

  if (error) {
    return (
      <Container>
        <Typography color="error">{error}</Typography>
      </Container>
    );
  }

  if (!student) {
    return (
      <Container>
        <Typography>Loading...</Typography>
      </Container>
    );
  }

  return (
    <Container>
      <Paper sx={{ p: 3, mt: 3 }}>
        <div style={{ marginBottom: '2rem' }}>
          <Button
            startIcon={<ArrowBackIcon />}
            onClick={() => navigate('/students')}
            sx={{ mb: 2 }}
          >
            Back to Students
          </Button>
          <Typography variant="h4" gutterBottom>
            Vaccination Records for {student.firstName} {student.lastName}
          </Typography>
          <Typography variant="subtitle1" color="textSecondary" gutterBottom>
            Student ID: {student.studentId}
          </Typography>
          <Typography variant="subtitle1" color="textSecondary">
            Grade: {student.grade} | Section: {student.section}
          </Typography>
        </div>

        <VaccinationRecordList
          studentId={studentId!}
          onEdit={handleEdit}
          onAdd={handleAdd}
        />

        <VaccinationRecordForm
          open={isFormOpen}
          onClose={() => setIsFormOpen(false)}
          onSubmit={handleSubmit}
          initialData={selectedRecord}
          studentId={studentId!}
        />

        <AddVaccinationRecordForm studentId={studentId} onRecordAdded={loadStudent} />
      </Paper>
    </Container>
  );
};

export default StudentVaccinationRecords;
